  constructor(props){
    super(props);
    this.state = { travels: [], orders: []};
    this.travelOrderService = new TravelOrderService();
  }

  tripsOrdersRelated = () =>  {
    //console.log(id)
   this.travelOrderService.getAllOrdersfromTravels(this.props.location.state.id)
   .then(tripsOrders => {

    this.setState({...this.state,
