    return (

      <div>

          <Navbar conditions={'trips'}/>
          <div>
          {/* <h2>{this.tripsOrders.travelFrom}</h2>
          <h2>{this.tripsOrders.travelTo}</h2> */}


          </div>

          <div>


          </div>

      </div>
    )
  }
}
